import React from 'react';



const StyledButton = styled.button`
    margin: 30px;
    height: 30px;
    width: 60px;
`

const Button = ({type, onClick, value}) => {
    return <StyledButton type={type} onClick={onClick} >{value}</StyledButton>
}

export default Button;
